$(document).ready(function(){
        $("#contact-form").submit(function(e){
                e.preventDefault();
                var data = new FormData(document.getElementById('contact-form'));
                $.ajax({
                        url: "/contact/",
                        type: "POST",
                        data: data,
                        cache: false,
                        contentType: false,
                        processData: false,
                        timeout: 1000 * 60,
                        tryCount: 0,
                        retryLimit: 5,
                        error: (xhr, textStatus, errorThrown) => {
                                this.tryCount++;
                                if(this.tryCount >= this.retryLimit) return;
                                $.ajax(this);
                        },
                        success: (data) => {
                                if(data == 'Message sent.') {
                                        $('#contact-submit').prop('disabled', true);
                                        $(this).trigger('reset');
                                }
                                document.getElementById('contact-message').innerHTML = data;
                                $('#contact-message').removeClass('hide');
                        },
                });
        });
});
function playSound(url) {
	var audio = new Audio(url);
	audio.play();
}
var spokenWordTimeout = null;
var gatheredSpeechUrls = [];
var spokenWordIndex = 0;
function speakWord() {
	if(spokenWordIndex > gatheredSpeechUrls.length - 1) return;
	var audio = new Audio(gatheredSpeechUrls[spokenWordIndex]);
	audio.play();
	spokenWordTimeout = setTimeout(speakWord, audio.duration * 1000 + 300);
}
function gatherPhrase(words) {
	for(var i = 0; i < words.length; i++) {
		var j = i;
		$.ajax({
			url: '/tts/' + words[i] + '/',
			method: 'POST',
		        timeout: 1000 * 60 * 30,
		        tryCount: 0,
		        retryLimit: 5,
			success: function(url) {
				gatheredSpeeckUrls[j] = url;
				if(j == words.length - 1) {
					speakWord();
				}
			},
			error: (xhr, textStatus, errorThrown) => {
		                this.tryCount++;
	       		        if(this.tryCount >= this.retryLimit) return;
		                $.ajax(this);
			},
		});
	}
}
function sayPhrase(phrase) {
	wordsToSpeak = phrase.toLowerCase().replace(',', '').replace('.', '').split(' ');
	clearTimeout(spokenWordTimeout);
	gatheredSpeechUrls = [];
	spokenWordIndex = 0;
	gatherPhrase(wordsToSpeak);
}

$(document).ready(function() {
    setTimeout(function(){
        $('body').addClass('loaded');
    }, 3000);
});

$(function() {
    $("video").on("play", function() {
        $("video").not(this).each(function(index, video) {
            video.pause();
        });
    });
});
let btns = document.querySelectorAll('#likeForm');
for (i of btns) {
	if(!i.classList.contains("ready")){
	       	i.classList.add("ready");
		$(i).attr('last-action', new String(new Date().getTime()));
     		$(i).on('submit', function(e) {
	        	e.preventDefault();
			if(parseInt($(this).prop('last-action')) - new Date().getTime() > -1000) return;
			$(this).attr('last-action', new String(new Date().getTime()));
        		var button = $(this).find(':submit');
        		button.toggleClass('btn-success');
        		button.toggleClass('btn-warning');
        		html = button.html();
        		likes = parseInt(html.match(/\d+/)[0]);
			if (button.hasClass('btn-warning')) {
        	        	button.html("<i class=\"bi bi-heart-fill\"></i> Unlike (" + (likes + 1).toString() + ")");
			} else {
        		        button.html("<i class=\"bi bi-heart\"></i> Like (" + (likes - 1).toString() + ")");
        		}
        		$.ajax({
        	        	url: $(this).attr('action') || window.location.pathname,
        	        	type: "POST",
        		 	data: $(this).serialize(),
	        		success: function(data) {},
        			error: function(xhr, response, error) {
               				alert("Please connect to the internet to interact with Clemn.");
        			}
        		});
        	});
	}
}
function copyToClipboard(element) {
    var $temp = $("<input>");
    $("body").append($temp);
    $temp.val($(element).text()).select();
    document.execCommand("copy");
    $temp.remove();
}
var urlParams = new URLSearchParams(window.location.search);
function updateURLParameter(url, param, paramVal) {
        var newAdditionalURL = "";
        var tempArray = url.split("?");
        var baseURL = tempArray[0];
        var additionalURL = tempArray[1];
        var temp = "";
        if (additionalURL) {
            tempArray = additionalURL.split("&");
            for (var i = 0; i < tempArray.length; i++) {
                if (tempArray[i].split('=')[0] != param) {
                    newAdditionalURL += temp + tempArray[i];
                    temp = "&";
                }
            }
        }
        var rows_txt = temp + "" + param + "=" + paramVal;
        return baseURL + "?" + newAdditionalURL + rows_txt;
}

